import React, { Component } from "react";
import { Link } from "react-router-dom";
import MiniPalette from './MiniPalette'

function PaletteList(props) {
    const {palettes}=props;
    return (
        <div>
            <MiniPalette/>
            <h1>React Colors</h1>
            {palettes.map(p=>(
                <MiniPalette {...p}/> 
            ))}
        </div>
    )
}

export default PaletteList
